import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (div with class 'cart' and text 'Cart')
    await page.waitForSelector('div.cart', { timeout: 5000 });

    // Click the cart element to open the shopping cart modal
    // Try several strategies to ensure the modal opens
    const cartDiv = await page.$('div.cart');
    if (!cartDiv) throw new Error("Cart element not found");
    await cartDiv.click();

    // Wait for the cart modal to appear (div#cartModal or class .modal with cart content)
    // Try both selectors for robustness
    let cartModal;
    try {
      cartModal = await page.waitForSelector('#cartModal', { timeout: 5000 });
    } catch {
      cartModal = await page.waitForSelector('.modal .cart-content', { timeout: 5000 });
    }

    // Wait for a heading or text indicating the cart modal is open
    await page.waitForSelector('text=Your cart', { timeout: 5000 }).catch(() => {});
    await page.waitForSelector('text=Cart', { timeout: 5000 }).catch(() => {});

    // Take screenshot after modal is open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract some cart modal data to verify
    let cartTitle = '';
    try {
      const cartTitleElem = await page.$('div.cart-content h2');
      if (cartTitleElem) {
        cartTitle = (await cartTitleElem.textContent()).trim();
      } else {
        // Try fallback selector
        const fallbackTitle = await page.$('text=Your cart');
        if (fallbackTitle) {
          cartTitle = (await fallbackTitle.textContent()).trim();
        }
      }
    } catch {}

    // Extract number of cart items if present
    let cartItemsCount = 0;
    try {
      const items = await page.$$('.cart-item');
      cartItemsCount = items.length;
    } catch {}

    return {
      success: true,
      action: "Opened the Shopping Cart Modal",
      extractedData: {
        cartTitle,
        cartItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
